import React from 'react';
import {useSpring, animated} from 'react-spring';

const SideBar = ({ open }) => {
  
  const props = useSpring({ from: {opacity: 1,marginRight:0}}, {to:{opacity:0,marginRight:500 }},{config:{delay:1000}});
  return (

    <animated.div style={props}
        
    > <h1>asdfasdfasd</h1></animated.div>
  );
};


export default SideBar;
